import React from 'react'
import { Formik, Form } from 'formik';

export const Login = () => {
    return (
        <Formik
        initialValues={{
            email: '',
            password: '',  
            }}
        >

            {formik => (
            <div>
            {console.log(formik.values)}
            <div className="form-box">
            <Form className="form-control-style">

                <h1 className="login-text"> Faça o login na sua conta! </h1>
                <input
                name="email" 
                type="email" 
                placeholder="E-mail"
                className="input-box" />

                <input
                name="password" 
                type="password" 
                placeholder="Senha"
                className="input-box"/>

                <button className="login-button"type="submit"> Entrar</button>

                <div className="linha-button"></div>

                <p className="text-cadastro">Não tem uma conta? <a href="#cadastro" className="cadastro-link">Cadastre-se</a></p>

                {/* <pre>{JSON.stringify(values, null, 2)}</pre> */}
            </Form>
            </div>
            </div>    
            )}
        </Formik>
    )
}
